import React from 'react';
import Nav from './components/Nav';
import './index.css';
import { Route } from 'react-router';
import About from './components/about/About';
import './App.css';

function App() {
  return (
    <div>
      <Nav />
      <div className="app">
      <Route path="/about">
        <About />
      </Route>
      </div>
    </div>
    );
}

export default App;
